pragma solidity ^0.8.0;
pragma abicoder v2;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/utils/structs/EnumerableSet.sol";
import "./NextItem.sol";

contract NextMarket is Ownable {

    using Counters for Counters.Counter;
    using EnumerableSet for EnumerableSet.UintSet;

    struct SellOrder {
        uint256 tokenId;
        uint256 quantity;
        uint256 askPrice;
        address erc20Contract;
        address seller;
    }

    struct BuyOrder {
        uint256 tokenId;
        uint256 quantity;
        uint256 buyPrice;
        address erc20Contract;
        address buyer;
    }

    Counters.Counter private _sellOrderIds;
    Counters.Counter private _buyOrderIds;

    mapping(uint256 => SellOrder) private sellOrders;
    mapping(uint256 => BuyOrder) private buyOrders;

    EnumerableSet.UintSet private availableSellOrders;
    EnumerableSet.UintSet private availableBuyOrders;

    address itemContract;
    NextItem public NFTs;

    event SellOrderCreated(uint256 sId);

    function setItemContract(address itemContract_) public onlyOwner {
        itemContract = itemContract_;
        NFTs = NextItem(itemContract);
    }

    modifier isValidTokenId(uint256 tokenId) {
        require(tokenId < NFTs.uniqueTokenNum(), "Invalid tokenId");
        _;
    }

    function createSellOrder(uint256 tokenId, uint256 quantity, uint256 price, address erc20Contract)
        public
        isValidTokenId(tokenId)
    {
        require(NFTs.balanceOf(msg.sender, tokenId) >= quantity, "insufficient token amount");
        require(price > 0, "Price must be greater than 0");

        NFTs.safeTransferFrom(
            msg.sender,
            address(this),
            tokenId,
            quantity,
            "0x0"
        );

        uint256 sId = _sellOrderIds.current();
        sellOrders[sId] = SellOrder({
            tokenId: tokenId,
            quantity: quantity,
            askPrice: price, 
            erc20Contract: erc20Contract,
            seller: msg.sender
        });
        _sellOrderIds.increment();
        availableSellOrders.add(sId);

        emit SellOrderCreated(sId);
    }


}
